import styled from "styled-components";

const Row = styled.div`
    display: flex;
    flex-direction: row;
    flex-wrap: nowrap;
    align-items: ${props = props.alignItems}};
    gap: ${props => props.gap};
`;

export default function FlexRow({
    children,
    gap = '0',
    alightItems = '',
}) {
    return(
        <Row gap={gap} alightItems={alightItems}>
            {children}
        </Row>
    );
}
